import React, { useState } from 'react';

const FormularioAtleta = ({ aoSalvar, aoCancelar }) => {
  const [categoria, setCategoria] = useState('');
  const [mostrarOutra, setMostrarOutra] = useState(false);

  const trocarCategoria = (e) => {
    if (e.target.value === 'OUTRA') {
      setMostrarOutra(true);
    } else {
      setMostrarOutra(false);
      setCategoria(e.target.value);
    }
  };

  return (
    <div style={{ padding: '20px', border: '2px solid #1a2a6c', borderRadius: '15px' }}>
      <form onSubmit={(e) => { e.preventDefault(); aoSalvar(); }}>
        <div style={{ marginBottom: '15px' }}>
          <label style={{ fontWeight: 'bold' }}>Nome do Atleta:</label>
          <input type="text" style={{ width: '100%', padding: '12px', fontSize: '1.1rem', borderRadius: '8px', border: '1px solid #ccc', marginTop: '5px', boxSizing: 'border-box' }} required />
        </div>

        <div style={{ marginBottom: '15px' }}>
          <label style={{ fontWeight: 'bold' }}>Categoria:</label>
          <select onChange={trocarCategoria} style={{ width: '100%', padding: '12px', fontSize: '1.1rem', borderRadius: '8px', marginTop: '5px' }}>
            <option value="">Selecione...</option>
            <optgroup label="Masculino">
              <option value="Masc A">Masculino A (Pró)</option>
              <option value="Masc B">Masculino B</option>
              <option value="Masc C">Masculino C</option>
              <option value="Masc D">Masculino D</option>
              <option value="Masc E">Masculino E (Iniciante)</option>
            </optgroup>
            <optgroup label="Feminino">
              <option value="Fem A">Feminino A (Pró)</option>
              <option value="Fem B">Feminino B</option>
              <option value="Fem C">Feminino C</option>
              <option value="Fem D">Feminino D</option>
              <option value="Fem E">Feminino E (Iniciante)</option>
            </optgroup>
            <option value="OUTRA">➕ CRIAR NOVA CATEGORIA...</option>
          </select>
        </div>

        {mostrarOutra && (
          <input type="text" placeholder="Nome da nova categoria" style={{ width: '100%', padding: '12px', marginBottom: '15px', borderRadius: '8px', border: '1px solid #1a2a6c', boxSizing: 'border-box' }} />
        )}

        <div style={{ display: 'flex', gap: '10px' }}>
          <button type="submit" style={{ flex: 1, padding: '15px', backgroundColor: '#27ae60', color: 'white', border: 'none', borderRadius: '8px', fontWeight: 'bold', fontSize: '1.1rem' }}>SALVAR</button>
          <button type="button" onClick={aoCancelar} style={{ flex: 1, padding: '15px', backgroundColor: '#e74c3c', color: 'white', border: 'none', borderRadius: '8px', fontWeight: 'bold', fontSize: '1.1rem' }}>VOLTAR</button>
        </div>
      </form>
    </div>
  );
};

export default FormularioAtleta;
